<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Prestige AI - Daily Newsletter</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            background-color: #f4f4f4;
            color: #333;
        }

        .container {
            max-width: 600px;
            margin: 20px auto;
            background-color: #fff;
            border-radius: 8px;
            overflow: hidden;
        }

        .header {
            background-color: #081a56;
            color: #fff;
            padding: 20px;
            text-align: center;
        }

        .header h1 {
            margin: 0;
            font-size: 24px;
        }

        .header p {
            margin: 5px 0 0;
            font-size: 14px;
        }

        .logo-container {
            text-align: center;
            padding: 10px;
        }

        .logo-container img {
            max-width: 200px;
            /* No height restriction */
            height: auto; /* Maintain aspect ratio */
            display: inline-block;
        }


        .content {
            padding: 20px;
        }

        .news-item {
            margin-bottom: 20px;
            border-bottom: 1px solid #eee;
            padding-bottom: 20px;
        }

        .news-item:last-child {
            border-bottom: none;
            padding-bottom: 0;
        }

        .news-item h2 {
            color: #081a56;
            font-size: 18px;
            margin: 0 0 10px;
        }

        .news-item p {
            font-size: 14px;
            line-height: 1.6;
            margin: 0 0 10px;
        }

        .news-item img {
            max-width: 100%;
            height: auto;
            border-radius: 4px;
            margin-bottom: 10px;
            display: block;
        }

        .news-item a {
            color: #16d1f2;
            text-decoration: none;
            font-weight: bold;
        }

        .footer {
            background-color: #081a56;
            color: #fff;
            padding: 20px;
            text-align: center;
            font-size: 12px;
        }

        .footer a {
            color: #16d1f2;
            text-decoration: none;
        }
        .joke-section {
            background-color: #f8f8f8;
            padding: 15px;
            border-top: 1px solid #eee;
            text-align: center;
            font-style: italic;

        }

    </style>
</head>
